import React, { useState, useEffect } from 'react';
import { useHistory } from 'react-router-dom';
import ServicesEleve from '../../services/ServicesEleve';
import ServiceFiliere from '../../services/ServiceFiliere';
import Modal from 'react-bootstrap/Modal';
import { Button } from 'react-bootstrap';
import ListGroup from 'react-bootstrap/ListGroup';
import { Container, Row, Col } from 'react-bootstrap';
const InsertFiliereEleve = (props) => {
    const [filiere, setFiliere] = useState([]);
    const [session, setSession] = useState();
    const [classe, setClasse] = useState([]);
    const [session_id, setSession_id] = useState();
    const [classe_id, setClasse_id] = useState();
    const [eleve_id, setEleve_id] = useState();
    useEffect(async () => {
        ServiceFiliere.getFiliere()
            .then(res => {
                const filieres = res.data.Filiere;
                setFiliere({ filieres });
                console.log(res.data.Filiere);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
        ServiceFiliere.getSession()
            .then(res => {
                const sessions = res.data.session;
                setSession({ sessions });
                console.log(res.data.session);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
        ServiceFiliere.getNiveauFiliere()
            .then(res => {

                const Classes = res.data.Classe;
                setClasse({ Classes });
                console.log(res.data.Classes);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
    }, []);
    const handleSubmit = async e => {
        e.preventDefault();
        var bodyFormData = new FormData();
        bodyFormData.append('num_matricule', props.matricule);
        ServiceFiliere.getByMatricule(bodyFormData)
            .then(res => {
                const eleve = res.data.result[0].id;
                setClasse({ eleve });
                console.log(res.data.result[0].id);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
        console.log('matricule=' + props.matricule);
        console.log('session=' + session_id);
        console.log('classe=' + classe_id);
    }
    return (
        <>
            <Modal {...props} aria-labelledby="contained-modal-title-vcenter">
                <Modal.Header closeButton>
                    <Modal.Title id="contained-modal-title-vcenter">
                        Choix Filiere
                    </Modal.Title>
                </Modal.Header>
                <Modal.Body className="show-grid">
                    <form onSubmit={handleSubmit} >
                        <label>
                            Session :
                            <select onChange={e => setSession_id(e.target.value)}>
                                {session?.sessions?.map(sess =>
                                    <option value={sess.id}>{sess.date_debut}//{sess.date_fin}</option>
                                )}
                            </select>
                        </label><br />
                        {filiere?.filieres?.map(fil =>
                            <Container>
                                <Row>
                                    <Col xs={12} md={5}>
                                        <li>{fil.Filiere}</li>
                                    </Col>
                                    <Col xs={12} md={5}>
                                        {classe?.Classes?.filter((filiere) => filiere.Filiere_id == fil.id)
                                            .map(filiere => <div>
                                                <li> {filiere?.Niveau} {filiere?.Groupe}</li>

                                                <Col xs={6} md={2}>
                                                    <label>
                                                        <input type="radio" name='Filiere' onChange={e => setClasse_id(filiere?.id)} />
                                                    </label><br />
                                                </Col>
                                            </div>

                                            )}
                                    </Col>

                                </Row>
                            </Container>

                        )}
                        <Button type="submit">Inseret</Button>
                    </form>
                </Modal.Body>
                <Modal.Footer>
                    <Button onClick={props.onHide}>Close</Button>
                </Modal.Footer>
            </Modal>
        </>
    )
};
export default InsertFiliereEleve;
